wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(50841745113452944196)
,p_plugin_type=>'REGION TYPE'
,p_name=>'SPECIFICITY_REGION_PLUGIN72566'
,p_display_name=>'Specificity Region Plugin'
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#jquery.inputmask.bundle.min.js',
'#PLUGIN_FILES#inputmask.min.js',
'#PLUGIN_FILES#spec.min.js'))
,p_css_file_urls=>'#PLUGIN_FILES#tooltip.min.css'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- Oracle APEX plugin: Specificity Region Plugin',
'-- GPM FACTORY - february 2023',
'-- https://github.com/',
'-- developer: Mohamed Lamri ',
'-- based on  ',
'',
'',
'FUNCTION render',
'    (p_region           IN APEX_PLUGIN.t_region',
'    ,p_plugin           IN APEX_PLUGIN.t_plugin',
'    ,p_is_printer_friendly IN BOOLEAN',
'    ) RETURN APEX_PLUGIN.t_region_render_result IS',
'    ',
'    SUBTYPE plugin_attr is VARCHAR2(32767); ',
'     ',
'    l_app_id                   plugin_attr := p_region.attribute_01;  -- Application id',
'    l_app_page_id              plugin_attr := p_region.attribute_02;  -- Page Id',
'    l_lang                     plugin_attr := p_region.attribute_03;  -- Languge',
'    l_group_id                 plugin_attr := p_region.attribute_04;  -- Group definition Id',
'    l_ref_id                   plugin_attr := p_region.attribute_05;  -- Ref Id',
'    l_save_btn_position        plugin_attr := p_region.attribute_06;  -- Save BTN position',
'    l_save_btn_label           plugin_attr := p_region.attribute_07;  -- Save BTN position',
'',
'    l_query                    varchar2(32767); ',
'    l_collection_name          varchar2(500);',
'    l_save_collection_name     varchar2(500);  ',
'    ',
'    l_result     APEX_PLUGIN.t_region_render_result;',
'    l_script     varchar2(32767);',
'    l_data       APEX_APPLICATION_GLOBAL.VC_ARR2;',
'    l_js_params  varchar2(1000);  ',
'    l_count      pls_integer; ',
'    timeline     varchar2(32000);  ',
'    tnames       varchar2(2000);',
'    tflag        varchar2(1);',
'    t2           varchar2(32000);',
'    tnb          integer := 0;',
'    tnbg         integer := 0; ',
'    t_nb         integer := 0;',
'    flag_edit    varchar2(10) := ''false'';',
'    tbox         INTEGER := 1;',
'    tapp         INTEGER := :APP_ID;',
'    l_ajax_id    VARCHAR2(100);',
' ',
'BEGIN',
'--l_app_id            :=  p_region.attribute_01;  -- Application id',
'--l_app_page_id       :=  p_region.attribute_02;  -- Page Id',
'l_collection_name      := ''SPC_'' || l_app_id || ''P?='' || l_app_page_id;',
'l_save_collection_name := ''SPC_DT_''||:APP_ID||''P?=''||:APP_PAGE_ID;',
'',
'-- delete collection used to save changed Specificities',
'IF apex_collection.collection_exists (l_save_collection_name) then',
'    APEX_COLLECTION.TRUNCATE_COLLECTION(',
'    p_collection_name => l_save_collection_name);',
'END IF;',
'',
'-- create or truncate collection',
'spc_display_hndl.init_spc( p_app_id   =>   l_app_id ',
'                      , p_page_id   =>  l_app_page_id ',
'                      , p_ref_type_id => null',
'                      , p_ref_id      => l_ref_id',
'                      , p_lang        => l_lang',
'    );',
'',
'-- generate collection query code',
'l_query := spc_display_hndl.get_spc_query( p_app_id    => l_app_id',
'                                    , p_page_id   => l_app_page_id',
'                                    , p_group_id  => 1);',
'',
'-- debug information will be included',
'IF APEX_APPLICATION.g_debug then',
'    APEX_PLUGIN_UTIL.debug_region',
'        (p_plugin => p_plugin',
'        ,p_region => p_region',
'        --,p_is_printer_friendly => p_is_printer_friendly',
'    );',
'END IF;',
'',
'-- -----------------------------------------',
'-- build the Javascript code and HTML markup',
'-- -----------------------------------------',
'',
'  htp.p(''<table id="spec-report">'');',
'  /*htp.p(''  <thead>''); --',
'  htp.p(''    <tr>'');',
'  htp.p(''      <th>''||p_region.attribute_01||''</th>'');',
'  htp.p(''      <th>''||p_region.attribute_02||''</th>'');',
'  --htp.p(''      <th>AAA</th>'');',
'  --htp.p(''      <th>AAA</th>'');',
'  htp.p(''    </tr>'');',
'  htp.p(''  </thead>'');*/ --',
'  htp.p(''  <tbody>'');',
'  for r_spec in (select c001 title, clob001 item, c003 help_text from apex_collections ',
'                     where collection_name = l_collection_name and n002 = nvl(l_group_id,n002)  order by n001 asc)                   ',
'  ',
'  loop',
'    htp.p(''    <tr>'');',
'    htp.p(''      <td><strong>'' || r_spec.title  || '':</strong></td>'');',
unistr('    htp.p(''      <td>\00A0\00A0\00A0\00A0</td>'');'),
'    htp.p(''      <td>'' || r_spec.item  || ''</td>'');',
'    --htp.p(''      <td>'' || ''<span class="a-Icon icon-help" aria-hidden="true"></span>'' || ''</td>'');',
'    --htp.p(''      <td class="tooltip"> Hover over me <span class="tooltiptext">Tooltip text</span> </td>'');',
'    if r_spec.help_text is not null then ',
'        htp.p(''      <td > <div class="tooltip"><span class="a-Icon icon-help " aria-hidden="true"></span> <span class="tooltiptext">''||r_spec.help_text||''</span></div></td>'');',
'    end if;',
'    htp.p(''    </tr>'');',
'  end loop;',
'  htp.p(''  </tbody>'');',
'  htp.p(''</table>'');',
'  -- display or not the Save button',
'  if l_save_btn_position != ''NA'' then',
'      htp.p(''<div class="t-ButtonRegion-wrap--right">',
'                <div class="t-ButtonRegion-col t-ButtonRegion-col--''||l_save_btn_position||''">',
'                   <div class="t-ButtonRegion-buttons"><button onclick="apex.submit({request:''''SAVE'''',validate:true});" class="t-Button t-Button--hot" type="button" id="SAVE_SPC_ID" data-form-type=""><span class="t-Button-label">''||nvl(l_save_btn_lab'
||'el,''Apply Changes'')||''</span></button></div>',
'                </div>           ',
'              </div>''); ',
'  end if; ',
'return l_result;',
'END;',
'',
'function ajax',
'  ( p_dynamic_action in apex_plugin.t_dynamic_action',
'  , p_plugin         in apex_plugin.t_plugin',
'  )',
'return apex_plugin.t_dynamic_action_ajax_result',
'as',
'    l_result apex_plugin.t_dynamic_action_ajax_result;',
'',
'    l_statement         p_dynamic_action.attribute_03%type := p_dynamic_action.attribute_03;',
'    l_sql_parameters    apex_exec.t_parameters;',
'    l_drag_id           varchar2(2000);',
'    l_drop_id           varchar2(2000);',
'    l_before            varchar2(32000);',
'    l_after             varchar2(32000);',
'begin',
'',
'    --debug',
'    if apex_application.g_debug and substr(:DEBUG,6) >= 6',
'    then',
'        apex_plugin_util.debug_dynamic_action',
'          ( p_plugin         => p_plugin',
'          , p_dynamic_action => p_dynamic_action',
'          );',
'    end if;',
'    ',
'    apex_debug.info(''clob %s'',apex_application.g_clob_01);',
'    ',
'    apex_json.parse(apex_application.g_clob_01);',
'    ',
'    if apex_json.does_exist (''swapped'')',
'    then',
'        l_drag_id := apex_json.get_varchar2(''swapped.dragId'');',
'        l_drop_id := apex_json.get_varchar2(''swapped.dropId'');',
'    else ',
'        l_drag_id := apex_json.get_varchar2(''sorted.dragId'');',
'        l_drop_id := apex_json.get_varchar2(''sorted.dropId'');',
'    end if;',
'    ',
'    l_before := apex_json.get_varchar2(''sequence.before'');',
'    l_after  := apex_json.get_varchar2(''sequence.after'');',
'',
'    -- bind only those variables which actually exist in the statement, otherwise it errors out',
'    if instr(upper(l_statement),'':DRAG_ID'')         > 0',
'    then',
'        apex_exec.add_parameter( l_sql_parameters, ''DRAG_ID''        ,  l_drag_id );',
'    end if;',
'',
'    if instr(upper(l_statement),'':DROP_ID'')         > 0',
'    then',
'        apex_exec.add_parameter( l_sql_parameters, ''DROP_ID''        ,  l_drop_id );',
'    end if;',
'',
'    if instr(upper(l_statement),'':BEFORE_SEQUENCE'') > 0',
'    then',
'        apex_exec.add_parameter( l_sql_parameters, ''BEFORE_SEQUENCE'',  l_before );',
'    end if;',
'',
'    if instr(upper(l_statement),'':AFTER_SEQUENCE'') > 0',
'    then',
'        apex_exec.add_parameter( l_sql_parameters, ''AFTER_SEQUENCE'' ,  l_after );',
'    end if;',
'',
'    ----------------------------------------------------------------------------',
'    -- this now runs the actual PL/SQL code',
'    ----------------------------------------------------------------------------',
'    apex_exec.execute_plsql',
'      ( p_plsql_code      => l_statement',
'      , p_auto_bind_items => true',
'      , p_sql_parameters  => l_sql_parameters',
'      );',
'',
'    -- prepare a json object as response for the client',
'    apex_json.initialize_output;',
'    apex_json.open_object;',
'',
'    apex_json.write(''status'', ''success'');',
'',
'    apex_json.close_object;',
'',
'    return l_result;',
'end ajax;',
''))
,p_api_version=>2
,p_render_function=>'render'
,p_standard_attributes=>'NO_DATA_FOUND_MESSAGE:ESCAPE_OUTPUT:INIT_JAVASCRIPT_CODE'
